import React, { Component } from 'react';

class Sidebar extends Component {
    render() {
        return (
            <aside className="main-sidebar">

                <section className="sidebar">

                    <ul className="sidebar-menu" data-widget="tree">
                        <li className="header">Menu Principal</li>

                        <li><a href="https://adminlte.io/docs"><i className="fa fa-dashboard"></i> <span>Dashboard</span></a></li>
                        <li><a href="https://adminlte.io/docs"><i className="fa fa-users"></i> <span>Clientes</span></a></li>
                        <li><a href="https://adminlte.io/docs"><i className="fa fa-cogs"></i> <span>Tickets</span></a></li>
                        <li><a href="https://adminlte.io/docs"><i className="fa fa-user"></i> <span>Usuarios</span></a></li>
                        <li><a href="https://adminlte.io/docs"><i className="fa fa-book"></i> <span>Tipos Suporte</span></a></li>
                        <li><a href="https://adminlte.io/docs"><i className="fa fa-book"></i> <span>Tipos Status</span></a></li>

                    </ul>
                </section>
            </aside>
        );
    }
}

export default Sidebar;
